import React, { useState } from 'react';

const fnGetRandom = () => Math.floor(Math.random()*10)//만약에 임폴트 익스폴트를 하면 공유는 할 수 있음

const CompLi = () => {
const [_num1, _setNum1] = useState(fnGetRandom()) //부모걸 갖다쓰면 같은 문제가 나오니까 여기서 스테잇 하는거.
const [_num2, _setNum2] = useState(fnGetRandom()) //부모걸 갖다쓰면 같은 문제가 나오니까 여기서 스테잇 하는거.
const [_ox , _setOX] = useState('x')

  return (
    <li>
     <span>{_num1}</span>
     +
     <span>{_num2}</span>
     =
     <input type="number" min="0" max="18"/>
     &nbsp;
     <b>{_ox}</b>
    </li>
  );
};

export default CompLi;
